INSERT INTO `faqs` VALUES
(1, 'چطور می‌تونم سفارش بدم؟', 'برای ثبت سفارش، فقط کافیه یکی از سرویس‌های پیشنهادی رو از داخل ربات انتخاب کنی. بعد از انتخاب مدت زمان و پرداخت (کارت به کارت یا زرین‌پال)، کانفیگ مخصوص شما به صورت خودکار برات ارسال می‌شه.', '2025-05-19 15:50:00', '2025-05-19 15:50:00'),
(2, 'چه روش‌های پرداختی دارید؟', 'ما دو روش پرداخت داریم: ۱. کارت به کارت ۲. زرین‌پال (درگاه پرداخت اینترنتی).', '2025-05-19 15:50:43', '2025-05-19 15:50:43'),
(3, 'تفاوت سرویس‌ها در چیه؟', '💡 سرویس اقتصادی: مناسب استفاده‌های عمومی مثل وبگردی، اینستاگرام، واتساپ و غیره 💎 سرویس طلایی (با تانل ایران): مخصوص کاربرانی که IP ایران نیاز دارن، برای اپ‌هایی مثل فیلیمو، شاد، صیانت‌دارها و... 🎮 سرویس گیمینگ: پینگ پایین و پایداری بالا برای بازی آنلاین (مثل Call of Duty، FIFA و...) 💰 سرویس ترید: آی‌پی ثابت و امن برای صرافی‌هایی مثل Binance، Bybit، KuCoin و...', '2025-05-19 15:52:09', '2025-05-19 15:52:09'),
(4, 'روی چه دستگاه‌هایی قابل استفاده‌ست؟', 'سرویس‌های ما بر پایه‌ی V2Ray هستن و روی هر دستگاهی که این پروتکل رو پشتیبانی کنه قابل استفاده‌ن، از جمله گوشی‌های 📱 اندروید (با اپ‌هایی مثل Hidify و v2rayNG)، آیفون 🍏 (با اپ‌هایی مثل Shadowrocket و Streisand)، کامپیوترهای 💻 ویندوز، مک، لینوکس و حتی برخی روترها و تلویزیون‌های هوشمند 📺 که از V2Ray پشتیبانی می‌کنن.', '2025-05-19 15:55:38', '2025-05-19 16:00:34'),
(5, 'کانفیگ‌ها محدودیت حجمی دارن؟', 'سرویس‌های ما از نظر حجم نامحدود هستن، اما توجه داشته باش که تمام کانفیگ‌ها دو کاربره هستن و در صورتی که بیشتر از ۲ دستگاه هم‌زمان به کانفیگ وصل بشن، سیستم به‌صورت 🔒 اتوماتیک کاربر رو بن می‌کنه تا از سوءاستفاده و افت کیفیت جلوگیری بشه؛ پس لطفاً فقط خودت از کانفیگ استفاده کن تا مشکلی پیش نیاد.', '2025-05-19 16:01:41', '2025-05-19 16:01:41'),
(6, 'اگه مشکلی پیش بیاد چی؟', 'پشتیبانی همیشه پاسخگو هست. میتونی پیام بدی تا مشکلت در سریع‌ترین زمان بررسی و برطرف بشه.', '2025-05-19 16:02:22', '2025-05-19 16:02:22'),
(7, 'چقدر طول می‌کشه تا کانفیگ برام ارسال بشه؟', 'در پرداخت از طریق زرین‌پال، ارسال به صورت آنلاین و آنی انجام می‌شه. در پرداخت کارت به کارت، پس از وارد کردن اطلاعات پرداخت، کانفیگ ظرف حداکثر ۵ دقیقه برات ارسال می‌شه.', '2025-05-19 16:02:41', '2025-05-19 16:02:41');
